/*!50003 DROP PROCEDURE IF EXISTS `poblar_agendamiento_dia_cupos` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `poblar_agendamiento_dia_cupos`(IN fecha_base DATE)
BEGIN
    DECLARE hora VARCHAR(5) DEFAULT '08:00';
    DECLARE fecha_hora DATETIME;
    DECLARE esp INT;
    DECLARE especialidad_nombre VARCHAR(100);
    DECLARE cupo_max INT;
    DECLARE i INT;

    DECLARE paciente_id INT;
    DECLARE paciente_nombre VARCHAR(45);
    DECLARE paciente_apellido VARCHAR(45);
    DECLARE paciente_rut INT;
    DECLARE paciente_dv VARCHAR(1);
    DECLARE paciente_fonasa INT;
    DECLARE paciente_pervision VARCHAR(45);

    DECLARE profesional_id INT;
    DECLARE profesional_nombre VARCHAR(45);
    DECLARE profesional_apellido VARCHAR(45);
    DECLARE profesional_rut INT;
    DECLARE profesional_dv VARCHAR(1);

    hora_loop: WHILE hora <= '19:30' DO

        SET esp = 1;

        esp_loop: WHILE esp <= 7 DO

            -- Establecer cupo máximo por especialidad
            IF esp IN (1, 7) THEN
                SET cupo_max = 4;
            ELSEIF esp IN (2, 3, 4, 5, 6) THEN
                SET cupo_max = 10;
            ELSE
                SET esp = esp + 1;
                ITERATE esp_loop;
            END IF;

            -- Obtener nombre de especialidad
            SELECT especialidad INTO especialidad_nombre
            FROM especialidad
            WHERE idespecialidad = esp;

            SET i = 0;
            WHILE i < cupo_max DO
                -- Obtener paciente aleatorio
                SELECT idpaciente, nombre, apellido, rut, dv, fonasa, pervision
                INTO paciente_id, paciente_nombre, paciente_apellido, paciente_rut, paciente_dv, paciente_fonasa, paciente_pervision
                FROM paciente
                ORDER BY RAND()
                LIMIT 1;

                -- Obtener profesional aleatorio con esta especialidad
                SELECT idprofesional, nombre, apellido, rut, dv
                INTO profesional_id, profesional_nombre, profesional_apellido, profesional_rut, profesional_dv
                FROM profesional
                WHERE idEspecialidad = esp
                ORDER BY RAND()
                LIMIT 1;

                -- Construir fecha y hora
                SET fecha_hora = STR_TO_DATE(CONCAT(DATE_FORMAT(fecha_base, '%Y-%m-%d'), ' ', hora), '%Y-%m-%d %H:%i');

                -- Insertar agendamiento
                INSERT INTO agendamiento (
                    cod_m, esp_m, fecha, hora,
                    vino, atendio, fonasa, rut, dv, idPaciente,
                    medico, especialidad, pervision
                )
                VALUES (
                    profesional_id, esp, fecha_hora, hora,
                    0, 0, paciente_fonasa, paciente_rut, paciente_dv, paciente_id,
                    CONCAT(profesional_nombre, ' ', profesional_apellido),
                    especialidad_nombre, paciente_pervision
                );

                SET i = i + 1;
            END WHILE;

            SET esp = esp + 1;
        END WHILE;

        -- Avanzar 30 minutos
        SET hora = DATE_FORMAT(ADDTIME(STR_TO_DATE(hora, '%H:%i'), '00:30:00'), '%H:%i');
    END WHILE;
END ;;
